class SessionStorage{add(id,objJson){try{var item=JSON.stringify(objJson);return sessionStorage.setItem(id,item),JSON.parse(item)}catch(e){console.log(e),alert("Erro ao adicionar dados em session storage!")}return!1}select(id){try{if(sessionStorage.length<=0)return!1;var item=sessionStorage.getItem(id);return null!=item&&""!==item&&void 0!==item||(item="{}"),JSON.parse(item)}catch(e){console.log(e),alert("Erro ao selecionar dados em session storage!")}return!1}selectAll(){try{var item={};if(sessionStorage.length<=0)return item;for(var i=0;i<sessionStorage.length;i++){var key=sessionStorage.key(i),itemList=sessionStorage.getItem(key);"object"==typeof itemList&&(itemList=JSON.parse(itemList)),item[key]=itemList}return item}catch(e){console.log(e),alert("Erro ao selecionar dados em session storage!")}return!1}delete(id){try{return sessionStorage.removeItem(id),!0}catch(e){console.log(e),alert("Erro ao deletar dados em session storage!")}return!1}}export default SessionStorage;